																				<div class=""wpb_wrapper"">
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						La Escuela Profesional de
																						Ingeniera de Sistemas
																						(EPIS)
																						inici su funcionamiento en
																						el
																						ao 1993 con la denominacin
																						de
																						Carrera Profesional de
																						Ingeniera de Sistemas.
																						Actualmente es parte de la
																						estructura orgnica de la
																						Facultad de Ingeniera y
																						Arquitectura de la
																						Universidad
																						Andina del Cusco y cuenta
																						con
																						una plana docente de 34
																						profesional");
                WriteLiteral(@"es.</p>
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						Durante ms de 26 aos, la
																						Escuela ha brindado servicio
																						a
																						un promedio de 450
																						estudiantes
																						por ciclo acadmico, el cual
																						tiene una duracin de 17
																						semanas. Cuenta con ms de
																						800
																						bachilleres, de los cuales
																						432
																						han obtenido el ttulo
																						profesional, que se
																						encuentran
																						laborando dentro y fuera de
																						nuestra regin.</p>
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						La estructura curricular ha
																						sido
																						act");
                WriteLiteral(@"ualizada en varias
																						ocasiones
																						con la finalidad de estar
																						acorde
																						al avance de la tecnologa,
																						tendencias del sector y
																						mercado
																						laboral. En el ao 2005 fue
																						aprobada la segunda
																						estructura
																						curricular y,
																						posteriormente, en
																						el ao 2013, se aprob una
																						tercera estructura. La malla
																						curricular vigente es la
																						aprobada en el 2016, y se
