																				<div class=""wpb_wrapper"">
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						La Escuela Profesional de
																						Ingeniera de Sistemas de la
																						Universidad Andina del Cusco
																						se
");
                WriteLiteral(@"																						encuentra acreditada bajo el
																						modelo del Instituto de
																						Calidad
																						y Acreditacin de Programas
																						de
																						Computacin, Ingeniera y
																						Tecnologa (ICACIT). La
																						acreditacin, otorgada en
																						2019
																						por un perodo de seis aos,
																						reconoce el logro de los ms
																						altos estndares de calidad
																						educativa y demuestra
																						nuestro
																						compromiso con la excelencia
																						en
																						la formacin de Ingenieros
																						de
																						Sistemas.</p>

																				</div>
