																				<div class=""dlh_subtitle""
");
                WriteLiteral(@"																					style=""font-size:16px; line-height:20px; "">
																					<span>SOBRE ICACIT</span>
																				</div>
																			</div>
																			<div
																				class=""wpb_text_column wpb_content_element "">
																				<div class=""wpb_wrapper"">
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						El Instituto de Calidad y
																						Acreditacin de Programas de
																						Computacin, Ingeniera y
																						Tecnologa es una agencia
																						acreditadora especializada
																						en
																						programas de formacin
																						profesional en computacin,
																						ingeniera y tecnologa en
																						ingeniera. ICACIT fomenta
																						la
																						mejora continua de la
																						calidad
																						ed");
                WriteLiteral(@"ucativa, garantizando que
																						lo
																						programas cumplan con los
																						ms
																						altos estndares
																						internacionales.</p>
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						ICACIT es integrante del
																						Washington Accord, un
																						acuerdo
																						entre las ms prestigiosas
																						agencias de acreditacin de
																						ingeniera en el mundo. En
																						el
																						Per, ICACIT est conformada
																						por
																						cinco sociedades
																						profesionales y
																						empresariales: Colegio de
																						Ingenieros del Per (CIP),
																						Confederacin Nacional de
																						Instituciones Empresariales
																						Privadas (CON");
                WriteLiteral(@"FIEP),
																						Asociacin
																						Peruana de Desarrolladores
																						de
																						Software (APESOF), Academia
																						Peruana de Ingeniera (API),
																						y
																						Seccin Per del IEEE.</p>

