																			<div
																				class=""wpb_text_column wpb_content_element "">
																				<div class=""wpb_wrapper"">
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						La Universidad Andina del
																						Cusco
																						ha implementado los
																						program");
                WriteLiteral(@"as de
																						tutora, en cada escuela
																						profesional, como un
																						mecanismo
																						para fortalecer los
																						conocimientos y destrezas
																						del
																						estudiantado. La tutora es
																						un
																						proceso de ayuda,
																						acompaamiento
																						y orientacin acadmica y
																						personal-social a los
																						estudiantes, desde su
																						ingreso
																						hasta la culminacin de sus
																						estudios.</p>
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						En la Escuela Profesional de
																						Ingeniera de Sistemas, este
																						acompaamiento y seguimiento
																						estudiantil se desarrolla
																						mediante accio");
                WriteLiteral(@"nes de
																						orientacin
																						e informacin y bajo
																						distintas
																						modalidades (atencin
																						individual
																						o colectiva), segn la
																						naturaleza de las
																						necesidades y
																						requerimientos del
																						estudiante o
																						del grupo por atender, a
																						travs
																						de los recursos humanos y
																						tecnolgicos con los que
																						cuenta
																						la UAC.</p>
																					<p
																						style=""color: #5e6a78; letter-spacing: -0.1px; text-align: justify;"">
																						La tutora es atendida por
																						docentes tutores acadmicos,
																						docentes tutores de
																						formacin,
																						docentes tutores de
																						insercin
										");
                WriteLiteral(@"												laboral &#8211;
																						coordinadores
																						del ejercicio
																						pre-profesional, y
																						pares tutores, quienes se
																						encargan de guiar, orientar,
																						acompaar y hacer el
																						seguimiento
																						al desempeo acadmico del
																						estudiante.</p>

